import React from "react";
import { Col, Container, Row } from "react-bootstrap";

const Cashier = () => {
  return (
    <div>
      <Container fluid>
        <Row>
          <Col md={6}></Col>
        </Row>
      </Container>
    </div>
  );
};

export default Cashier;
